import React from "react";
import Menu from "semantic-ui-react/src/collections/Menu";


const Filter = () => {
    <Menu secondary>
        <Menu.Item>Все</Menu.Item>
        <Menu.Item >Цена Дорогие</Menu.Item>
        <Menu.Item>Цена Дешевые</Menu.Item>
        <Menu.Item>По моделям</Menu.Item>
    </Menu>
};
export default Filter
